HISTORY OF DAMASCUS STEEL:

From 300 BC to 1700 AD Damascus steel was the high quality steel used in blades and it was famous for making strong swords so well-forged that it could bent under pressure without breaking, yet held an edge so sharp it could cleave a big piece of wood in half with only the force behind one arm.
 

During Middle Ages Damascus steel was used to make swords and the art of making Damascus steel was considered as a secret.

Then a time came when process for making the original Damascus steel was lost. But it emerged again though modern day Damascus knives are not made in the same way as the medieval Damascus blades. The reasons for this are obvious, as no one knows exactly how those blades were made.

