('Multipack Inflatable Beach Balls w/BONUS &quot;Lets Party!&quot; Can Cooler Koozie - Exciting Summery Colors', '77', 'http://ecx.images-amazon.com/images/I/41xgxzYK%2B0L._SX300_.jpg', 'Blow this summer up!C''mon, now. The sun is out, there''s greenery everywhere, and the tantalizing smells ofcharred meat is all around you. Unless you can''t take a hint, this means it''s time to kicksummer into high gear. So collect a group of besties, head out to the nearest beach,blow up a few of our inflatable beach balls, and attempt to break the world record forthe longest game of volleyball ever played. For a good reference point, know this: In July2010, a team of Germans played a game of beach volleyball that lasted 25 hours and 39minutes. Good luck.A Koozie for the BoozeAre you more of a spectator type? Don''t worry; we''ve got you covered too. Included inthis pack of beach balls is a bonus koozie cut from insulating cloth. It fits perfectly on yourstandard can of beer or soda, and keeps your beverage cool for up to 35 minuteslonger. So slip in your favorite drink and watch your friends trying their hands at somevolleyball competition. And lest anyone mistakes your intentions for hanging out at thebeach, the koozie features a "Let''s Party!" callout that basically serves as an invite toanyone on team USA.', '2', '40', 'f', '2021-07-19 17:18:15.377654+00', '2021-07-19 17:18:15.377654+00'),
('Backpack Laundry Bag From Keeble Outlets with Two Shoulder Straps, Medium Size (22 Inches X 28 Inches), Commercial Grade 100% Nylon and Made in the USA - Easy to Carry Laundry Bag Designed for Heavy Duty Use - Back to College Laundry Bag - Trips to Laundromat - Back to School Must Have', '159', 'http://ecx.images-amazon.com/images/I/41OyhxmFq0L._SY300_.jpg', 'A laundry bag that is big yet easy to carry, commercial grade and made in The USA!

