th children, but they work dieting magic for seniors, adults and teens as well.Yum Yum Dishes come in four colors and are artistically designed. Each bowl also includes encouragement to end your snacking, letting you know that "Yum Yum time is... Over."Why weight? Order today.', '7', '56', 'f', '2021-07-19 17:18:15.507116+00', '2021-07-19 17:18:15.507116+00'),
