('FitBalls: Hand Strengthener &amp; Hand Exerciser. Relief From Texting, Typing &amp; Repetitive Strain Injury. Wrist Exerciser &amp; Strengthener. Alleviates &amp; Prevents Carpal Tunnel &amp; Tendonitis ~ Includes Exclusive FitBalls Hand Therapy &amp; Fitness Guide.', '142', 'http://ecx.images-amazon.com/images/I/51v%2B1Jy%2BWDL._SY300_.jpg', 'Everyday use of your phone, tablet and computer can be a source of pain in your fingers, wrists, forearms - even neck. Hours of improper positioning of your hand and wrist can also aggravate conditions like carpal tunnel syndrome and tendinitis which are linked to overuse and repetitive motions of your hands or fingers.FitBalls provide an easy and convenient solution to these ever increasing problems.The three color-coded fitness and therapy balls of increasing resistance will strengthen and restore flexibility to your fingers, hands and forearms. The Easy-To-Follow Fitness & Therapy Guide includes specific exercises that target these areas and provide fast relief. The guide also includes exercises to relieve hand and wrist pain associated with guitar playing and writing.', '4', '77', 'f', '2021-07-19 17:18:16.264279+00', '2021-07-19 17:18:16.264279+00'),
('Mafia the Party Game', '239', 'http://ecx.images-amazon.com/images/I/519iUttQqZL._SX300_.jpg', 'This Mafia card set is all you need to play Mafia in style. It comes with 27 cards and a logo pouch.

Each set comes with five Mafia cards, one Detective, one Doctor, 12 Civilians (6 female, 6 male), one Godfather, one Barman, two Rival Mafia, one Cupid, one Lawyer, one Vigilante, and one Role Cheat Sheet card.

Mafia Rules:

There are two teams, Mafia and Civilians. And there are two phases, day and night. The civilians win if they eliminate all the mafia players and the mafia win if they outnumber the civilian players.

First, choose someone to be the narrator. The narrator hands out the cards and may either randomly assign roles or may choose what role each player gets.

Night Phase:

The narrator then tells everyone to go to sleep. All players lower their heads and close their eyes as to not see what happens next. The narrator then tells the mafia players to wake up. Those players that drew the mafia cards raise their heads quietly and see who else is on their team. The narrator then asks the mafia to point to the player they want to kill. The mafia quietly agree to and point to the player they wish to kill and after the narrator acknowledges their target, the narrator asks the mafia to go to sleep.

Day Phase:

The narrator tells everyone to wake up. The narrator then tells the group, by name, the player that was killed by the mafia. The narrator is encouraged to be creative and make a compelling story line for the players to follow. The remaining players then have to debate who they think the mafia are. The mafia will act, bluff, lie, and pretend not to be the mafia as not to get caught. Everyone votes for one player to "lynch" or kick out of town. That player is eliminated and it''s up to the narrator if he/she wants to disclose that player''s role.

The night phase comes again and the game keeps going until there are no mafia left or the mafia outnumber the civilians.', '2', '81', 'f', '2021-07-19 17:18:16.264279+00', '2021-07-19 17:18:16.264279+00'),
