('Dreampad - Bone Conduction Pillow', '350', 'http://ecx.images-amazon.com/images/I/41TspUF1xSL._SY300_.jpg', 'The Dreampad combines iLs'' psychoacoustic expertise with Intrasound TechnologyTM, which is based on the natural conductivity of the human body. Our bones are natural conductors; in fact, every time you speak the vibration caused by your voice is carried by bone to your inner ear. In the same way, music from the Dreampad travels internally to your ear...Intrasound TechnologyTM replicates this natural process by using electromechanical transducers to convert the electrical signals of the music into vibrations. The vibrations are carried by bone to the area surrounding the inner ear, which plays a key role in our hearing, balance, coordination and our ability to filter out unwanted noise. It is also an area which is connected to our Parasympathetic Nervous System (PNS) through the Vagus Nerve.Parasympathetic stimulation facilitates our relaxation response (as opposed to our Sympathetic Nervous System, which gives us "fight or flight"). Preliminary research shows that the Dreampad is effective in stimulating the PNS, resulting in a calming response which aids in falling, and staying, asleep. Research is underway to further explore the effect of the Dreampad on the following populations: stress-related insomnia, trauma, veterans with PTSD, children with ADHD and ASD, and cancer patients experiencing insomnia.Regarding its origins, the Dreampad technology was first developed by iLs (Integrated Listening Systems) to help children who experience anxiety and sleep difficulties.  As parents witnessed its effectiveness, they began trying it themselves and reporting equally positive results.  The product was then refined for use by all ages and re-released to both therapeutic and consumer audiences.  iLs is a multi-sensory brain fitness program which is used primarily by those with learning and attention challenges, as well as for head injury and stroke rehab.www.dreampadsleep.com', '7', '45', 'f', '2021-07-19 17:18:16.264279+00', '2021-07-19 17:18:16.264279+00'),
