('LassoTag iBeacon - Black', '155', 'http://ecx.images-amazon.com/images/I/41I-oc4hr6L._SY300_.jpg', '~Wouldn''t it be cool if~
Radius Alert Systems was founded on a question.  Wouldn''t it be cool if my bag called my phone?  My son called me one day and asked me that question.  He had just walked away from a camera bag he had set down at the zoo.  As he was telling me the story, he asked me if there was a way his camera bag could have been smart enough to call him when he walked away.  The answer is yes.  It only needs a technology upgrade and then yes, your bag will call your phone when you walk away.  

~LassoTag iBeacons~
LassoTag is a combination of mobile software and the latest Blue Tooth Low Energy (BTLE) iBeacon solutions for both the consumer and enterprise.   It is high tech, easy to use, and integrates with the Smart phone.  The LassoTag mobile software is designed to alert the Smart phone when the LassoTag iBeacon or other BTLE enabled device(s) are outside the radius of the Smart Phone. This means when you walk away from your bag, coat, keys, purse, etc; LassoTag will call your phone.  The LassoTag iBeacon is Apple iBeacon Certified in addition to FCC and CE.  The design is small, efficient, and durable.  It comes in 7 colors.  Battery is Replaceable.

~LassoTag Mobile App~
Our team has built the industry leading consumer mobile software solution and platform.  The LassoTag Application allows the customization of the alerts; icons; and responses to fit the needs of the customer easily and efficiently.  We kept asking ourselves the question, ''Wouldn''t it be cool if...''  This led to the design of several cool features. 

-> A map feature that will drop a pin whenever your phone gets separated.
-> Cloud Services so you can find your valuables from any location.
-> Passive Server Tracking which securely tracks your LassoTag by crowd sourcing.
-> 3 Tier notification via phone notification alert, text message, and phone call.
-> Hot/Cold Search and Rescue.  
-> Android currently in development (Coming Soon!!)', '5', '8', 'f', '2021-07-19 17:18:16.397204+00', '2021-07-19 17:18:16.397204+00'),
