('Farm Sprayer GPS Country Edition', '327', 'http://ecx.images-amazon.com/images/I/51ummDylzcL._SX300_.jpg', 'When technology meets agriculture there becomes the opportunity to make farming more efficient. With Farm Sprayer GPS Country Edition you can utilize advanced guidance and GPS tools for the fraction of the price of competitors.

Farm Sprayer GPS Country Edition is designed for spraying, but also works well with tillage, planting, spreading fertilizer or anything else that works better when you can see the ground you have covered.

Farm Sprayer GPS Country Edition has two modes. A circle tracking mode highlights the portion of the field you have sprayed at the boom width that you enter. Line mode places parallel lines at the width you input and then as you travel the area is filled in similar to the circle mode.

Farm Sprayer GPS Country Edition comes with a 7" android tablet loaded with the Farm Sprayer GPS software, suction cup, tablet holder, and charger. The Country Edition has the GPS antenna built into the tablet.

Not only do you get a guidance system, but you get a tablet you can use for everything else too.


The technological advantage without breaking the bank.

Farm Sprayer GPS allows you to see where you have been in the field.

You can set the width of your boom, tillage equipment, or even planter and Farm Sprayer GPS Country Edition will highlight that area on the map as you travel

Line travel mode will project parallel lines for you to follow that are boom width apart. A heading line is projected for you to line up with the parallel lines.

Farm Sprayer GPS Country Edition has a built in GPS receiver and DOES NOT include an external receiver like the Ultimate and Pro models do.

Farm Sprayer GPS is android based meaning you get the powerful tool of field guidance, plus a tablet that you can take into the home and use for other business.', '5', '14', 'f', '2021-07-19 17:18:16.517123+00', '2021-07-19 17:18:16.517123+00'),
