('Rep Slam Balls for CrossFit and Conditioning', '450', 'http://ecx.images-amazon.com/images/I/51q%2BiSi1nHL._SY300_.jpg', 'Slam Balls for CrossFit and ConditioningSlam balls are used for exactly what it sounds like--slamming them on the ground! Normal medicine balls or wall balls can''t take that kind of abuse, but the Rep Slam Ball is designed to be thrown to the ground thousands of times without breaking. Grippy textured rubber shell, with sand inside for weight.Why Use Slam Balls?While the CrossFit slam ball movement is very popular, they are also a great way to train for almost any sport because of the explosive full body movement behind slamming them down and picking them up quickly. You get the cardio benefit of the lighter weights, and the strength and cardio on the heavy balls. Whether it be for MMA, football, wrestling, or just general athletic training. There is some give to the balls, so your grip is being challenged, along with your core, posterier chain, and arms... a full body workout! Also a great stress reliever after a long day at work!Slam Ball Size RecommendationsThis is dependent on your strength, but generally speaking, we see females in the 10lb to 25lb range, and males in the 20lb to 40lb range. Kids and beginners do great on a 10lb slam ball, while a fairly strong male should be able to handle a 30lb slam ball just fine!Warranty InfoRep Slam Balls are highly durable and come with a 3 year warranty for home use, 1 year for commercial use.', '4', '50', 'f', '2021-07-19 17:18:16.517123+00', '2021-07-19 17:18:16.517123+00'),
('Power LogOn Password Administrator Starter Kit - The affordable alternative to PKI', '204', 'http://ecx.images-amazon.com/images/I/51LerJn7IGL._SY300_.jpg', 'Power LogOn gives IT the power to centrally control passwords that follow corporate security policies. It''s an enterprise password management solution where employees no longer have to remember, type or even know their passwords. Complex passwords can be implemented, password resets are eliminated reducing help desk costs, and government required multifactor authentication (MFA) can be quickly deployed delivering up to eight levels of assurance.
 

The kit includes everything to fully test every security feature of Power LogOn Enterprise Password Management and run a six-person pilot. After a successful pilot, deployment is even easier. No additional software or server modifications are required. Just purchase any additional licenses, cards and/or readers to meet your organizations requirements.
 

Power LogOn works with over 50 different card technologies like magstripe, proximity, contact smartcards, contactless smartcards, and soon NFC.  Power LogOn can also be added to your existing ID badges without having to recall or re-issue any new badges.  Employees self-enroll to eliminate the high issuance costs found in other MFA systems. 
 

We are so confident that Power LogOn will work in your business that we offer a 90-day, 100% money back guarantee if you are not completely satisfied. Power LogOn is designed to work for professional practices, corporations, government agencies, and educational institutions. Power LogOn is scalable from one person to thousands. Power LogOn has no annual or monthly subscription fees and all licenses are transferable to accommodate employee/student turnover.', '5', '34', 'f', '2021-07-19 17:18:16.517123+00', '2021-07-19 17:18:16.517123+00'),
